    title: "Вереники з телятиною",
  },
  {
    imageUrl:
      "https://st2.depositphotos.com/1022597/5430/i/600/depositphotos_54308177-stock-photo-pasta-food.jpg",
    title: "Вереники з шашликом",
  },
];

function App() {
  return (
    <div class="wrapper">
      <Header />

      <div class="content">
        <div class="container">
          <div class="content__top">
            <Categories />
            <Sort />
          </div>
          <h2 class="content__title">Всі вареники</h2>
          <div class="content__items">
            <VarenukBlock />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
